import React from "react";
import "./Logo.scss";
import { ReactComponent as SpaceXLogoSVG } from "../../../assets/SpaceXLogo.svg";

const Logo = () => {
  return (
    <div className="logo-container">
      <SpaceXLogoSVG fill="#000" />
      <a>CARGO PLANNER</a>
    </div>
  );
};

export default Logo;
